import React from "react";
import "../css/homepage.css";

const Homepage = () => {
  return (
    <div className="">
      <main id="main">
        <div class="row Container">
          <div class="col-3">
            <img src="images/logo--white.png" class="img-fluid" alt="" />
          </div>
          <div class="col-3">
            <img src="images/logo--white.png" class="img-fluid " alt="" />
          </div>
          <div class="col-lg-3">aaaaaaaa</div>
          <div class="col-3">aaaaaaaa</div>
        </div>
      </main>
    </div>
  );
};

export default Homepage;
